import React, { Component } from 'react';
import './App.css';
import LyricsForm from './lyrics/lyricsForm'
import Header from './layout/Header';
import LyricsList from './lyrics/lyricsList';
import Background from '../public/images/cloudLightning.png';

class App extends Component {
  render() {

    var sectionStyle = {
      width: "100%",
      height: "400px",
      backgroundImage: "url(" + { Background } + ")"
    };
    return (
      <div>
        {/* <Header></Header> */}
        <div className="Mint">
          <header className="App-header">
            <h1>Lyrical OG</h1>
            {/* <LyricsList/> */}
          </header>

          <LyricsForm style={{sectionStyle}}/>
        </div>
      </div>
    );
  }
}

export default App;
